import React, { useEffect } from "react"
import { Flex, Text, Box, Image } from "rebass"

export default props => {
	return (
		<Flex
			flexDirection="column"
			alignItems="center"
			justifyContent="center"
			height="6.4rem"
			width="6.4rem"
			bg="#E7E7E7"
			sx={{
				cursor: "pointer",
				"&:hover": {
					background: "#fff"
				}
			}}
		>
			<Image
				src="/4/style2.png"
				mr={"10px"}
				sx={{
					width: "2.15rem",
					minWidth: "14px",
					minHeight: "14px"
				}}
			/>
			<Image
				src="./4/style1.png"
				mr={"10px"}
				sx={{
					width: "2.15rem",
					minWidth: "14px",
					minHeight: "14px"
				}}
			/>
			<Box>
				<Image />
			</Box>
		</Flex>
	)
}
